import React from 'react';
import Cards from './Cards';
import data from './data';
import './index.css'

function App() {
    return (
        <>
        <h1 className='heading'>Top 10 Courses for Software Engineering 2021</h1>
        <div className='main'>
            <Cards
                imgscr={data[0].imgscr}                
                category={data[0].category}
                name={data[0].name}
                link = {data[0].link}
            />
            <Cards
                imgscr={data[1].imgscr}
                category={data[1].category}
                name={data[1].name}
                link = {data[1].link}
            />
            <Cards
                imgscr={data[0].imgscr}
                category="Engineering"
                name='Software Engineering'
                link = '#'
            />
            <Cards
                imgscr='https://picsum.photos/200/300'                
                category="Engineering"
                name='Software Engineering'
                link = '#'
            />
            <Cards
                imgscr='https://picsum.photos/250/300'
                category="Engineering"
                name='Software Engineering'
                link = '#'
            />
            <Cards
                imgscr='https://picsum.photos/300/300'
                category="Engineering"
                name='Software Engineering'
                link = '#'
            />
            </div>
        </>
    );
}

export default App;
